import React from 'react'
import { useHistory } from 'react-router-dom'
import { useParams } from 'react-router-dom'

const Daily = (props) => {
    const Myday = useParams();
    console.log(Myday)

    return (
    <div style={{width: "100vh", margin: "0px auto"}}>
        <h2 style={{margin: "40px auto"}}>
            <span style={{backgroundColor:"lemonchiffon", borderRadius:"20px"}}>화요일 </span>평점 남기기
            <div> {Myday} </div>
        </h2>

    </div>
    )
}

export default Daily
